import React from 'react'
import './Cleaner.scss'

class Cleaner extends React.Component {
    render() {
        let cleaners = ['C', 'AC'];
        return (
            cleaners.map((cleaner) => {
                return (
                    <button className='ac'>
                        {cleaner}
                    </button>
                )
            })
        )
    }
}

export default Cleaner;
